import React, { Component } from 'react';

export default class PathFindVisualizer extends Component {
    constructor(props){
        super(props);
        this.state = {};
    }
    render(){
        let node = {
            width:"20px",
            height:"20px",
            backgroundColor:"white",
            outline:"1px solid rgba(144, 175, 175, 0.75)",
            display:"inline-block"
        };
        return(
        <>
        <div style={node}>
        </div>
        <div style={node}>
        </div>
        </>
        );
    }
}
